        jLabel2.setFont(new java.awt.Font("Arial", 0, 12)); // NOI18N
        jLabel2.setText("<html><p style=\"text-align:justify;\">&emsp;&emsp;&emsp;&emsp;On September 2001, Executive Order No. 36 was signed by President Gloria Macapagal-Arroyo transferring South Cotabato, Sarangani, General Santos (also known as the SocSarGen District), and Koronadal from Southern Mindanao to Region XII, and renaming the region, from Central Mindanao, to SOCCSKSARGEN.[2][6]\n<br>\n&emsp;&emsp;&emsp;Koronadal City, New Regional Center\nBy virtue of Executive Order No. 304 signed by then President Gloria Macapagal-Arroyo, Koronadal City was named as the Regional political and socio-economic center of SOCCSKSARGEN on March 30, 2004. Regional departments, bureaus and offices were ordered to move from Cotabato City, the former Regional Center of the Region.\n<br>\n&emsp;&emsp;&emsp;Cotabato City Exit\nTraditionally resisting efforts for inclusion to the Autonomous Region in Muslim Mindanao despite serving as the government center of the ARMM, the January 21, 2019 Bangsamoro Autonomous Region creation plebiscite resulted in the surprise ratification of the Bangsamoro Organic Law. This means Cotabato City may now formally serve as the capital of the region and the offices of the current ARMM will be retained for use by the Bangsamoro Regional Government and now formaly exited to the SOCCSKSARGEN Region.");
        jPanel3.add(jLabel2, new org.netbeans.lib.awtextra.AbsoluteConstraints(30, 440, 350, 370));

        jPanel1.add(jPanel3, new org.netbeans.lib.awtextra.AbsoluteConstraints(0, 0, 400, 1900));

