        jLabel3.setFont(new java.awt.Font("Arial", 1, 36)); // NOI18N
        jLabel3.setText("Tourist Spots");
        jPanel1.add(jLabel3, new org.netbeans.lib.awtextra.AbsoluteConstraints(720, 10, -1, -1));

        jLabel4.setFont(new java.awt.Font("Arial", 0, 14)); // NOI18N
        jLabel4.setText("<html><p style=\"text-align:justify;\">If water rafting is done with a rubber boat to which can be ridden by 4-6 people, Maitum's river tubing entails riding an old school salbabida (flotation device) which is somewhat attached to another salbabida ridden by a rafting guide. I actually find it a clever and cheaper alternative to rubber boats. It's like water rafting but way cooler! ");
        jPanel1.add(jLabel4, new org.netbeans.lib.awtextra.AbsoluteConstraints(480, 390, 760, 80));

        jLabel5.setIcon(new javax.swing.ImageIcon(getClass().getResource("/philippine_map/soc1.png"))); // NOI18N
        jLabel5.setBorder(javax.swing.BorderFactory.createLineBorder(new java.awt.Color(0, 0, 0)));
        jPanel1.add(jLabel5, new org.netbeans.lib.awtextra.AbsoluteConstraints(560, 130, 540, 250));

        jLabel7.setFont(new java.awt.Font("Arial", 1, 24)); // NOI18N
        jLabel7.setText("White Water River Tubing (Maitum, Sarangani)");
        jPanel1.add(jLabel7, new org.netbeans.lib.awtextra.AbsoluteConstraints(480, 90, -1, -1));

        jLabel10.setFont(new java.awt.Font("Arial", 1, 24)); // NOI18N
        jLabel10.setText("Visit Pacman and Mommy D's mansions (GenSan)");
        jPanel1.add(jLabel10, new org.netbeans.lib.awtextra.AbsoluteConstraints(480, 540, -1, -1));

        jLabel11.setIcon(new javax.swing.ImageIcon(getClass().getResource("/philippine_map/soc2.png"))); // NOI18N
        jLabel11.setBorder(javax.swing.BorderFactory.createLineBorder(new java.awt.Color(0, 0, 0)));
        jPanel1.add(jLabel11, new org.netbeans.lib.awtextra.AbsoluteConstraints(560, 580, 540, 250));

        jLabel15.setFont(new java.awt.Font("Arial", 0, 14)); // NOI18N
        jLabel15.setText("<html><p style=\"text-align:justify;\">As this is the home of the famous boxing legend Manny Pacquiao, you might like to take a peek at where he stays, from the outside, at least. The Pacman 'mansion' looks simple on the outside but the compound has its own basketball court and a separate receiving hall.\n\nMommy D's house is not far from Manny's. It is situated in a simple subdivision. We would at least have liked to see her, but the guard told us that Mommy D had left earlier in the day.\n\nWe also dropped by Pacman's Wild Card Gym. It is located on the 3rd floor of his building across SM GenSan.");
        jPanel1.add(jLabel15, new org.netbeans.lib.awtextra.AbsoluteConstraints(480, 840, 760, -1));

        jLabel16.setFont(new java.awt.Font("Arial", 1, 24)); // NOI18N
        jLabel16.setText(" Zipline at 7 Waterfalls (Lake Sebu, South Cotabato)");
        jPanel1.add(jLabel16, new org.netbeans.lib.awtextra.AbsoluteConstraints(480, 950, -1, -1));

        jLabel17.setIcon(new javax.swing.ImageIcon(getClass().getResource("/philippine_map/soc3.png"))); // NOI18N
        jLabel17.setBorder(javax.swing.BorderFactory.createLineBorder(new java.awt.Color(0, 0, 0)));
        jPanel1.add(jLabel17, new org.netbeans.lib.awtextra.AbsoluteConstraints(570, 1000, 540, 250));

        jLabel18.setFont(new java.awt.Font("Arial", 0, 14)); // NOI18N
        jLabel18.setText("<html><p style=\"text-align:justify;\">Sulit (worth it). For P250/head you can get to ride not one, but two ziplines.\n\nNote that only falls one and two can be reached on foot and the remaining 5 waterfalls can be spotted when you ride the zipline. You won't only get a glimpse of the view of the magnificent waterfalls, but you can also get to experience the awesome feeling of flying.");
        jPanel1.add(jLabel18, new org.netbeans.lib.awtextra.AbsoluteConstraints(480, 1250, 760, 80));

        jLabel20.setIcon(new javax.swing.ImageIcon(getClass().getResource("/philippine_map/soc4.png"))); // NOI18N
        jLabel20.setBorder(javax.swing.BorderFactory.createLineBorder(new java.awt.Color(0, 0, 0)));
        jPanel1.add(jLabel20, new org.netbeans.lib.awtextra.AbsoluteConstraints(570, 1450, 540, 250));

        jLabel22.setFont(new java.awt.Font("Arial", 1, 24)); // NOI18N
        jLabel22.setText("Relax at Lake Sebu (South Cotabato)");
        jPanel1.add(jLabel22, new org.netbeans.lib.awtextra.AbsoluteConstraints(480, 1400, -1, -1));

        jLabel23.setFont(new java.awt.Font("Arial", 0, 14)); // NOI18N
        jLabel23.setText("<html><p style=\"text-align:justify;\">Try just quietly viewing the lake and you'll feel yourself calm down. There's something about Lake Sebu that make you feel relaxed. We stayed at Punta Isla, a 'lakefront' resort and the room they gave us was elevated, so we had a great view of the whole lake. (IN PHOTOS: 8 PH lakes to add to your travel bucket list)\n\nSome of the resort accommodations offer fan rooms only as the cold breeze from the lake will often make up for the warm weather. Room for 4 people starts at P1,100. (READ: Mornings made better at Lake Sebu)");
        jPanel1.add(jLabel23, new org.netbeans.lib.awtextra.AbsoluteConstraints(480, 1700, 760, 140));

